import Foundation
import XCTest

@testable import SystemStrings

// MARK: - Accounts Tests

@available(iOS 5.0, *)
final class AccountsStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜Accounts.preferredLocalization = nil
    }

    func test_default() {
        Util｜Accounts.preferredLocalization = nil
        XCTAssertEqual(String.ACCOUNT_ACCESS_MESSAGE｜Accounts, "\u{201C}\u{25}\u{31}\u{24}\u{40}\u{201D}\u{20}\u{57}\u{6F}\u{75}\u{6C}\u{64}\u{20}\u{4C}\u{69}\u{6B}\u{65}\u{20}\u{41}\u{63}\u{63}\u{65}\u{73}\u{73}\u{20}\u{74}\u{6F}\u{20}\u{25}\u{32}\u{24}\u{40}\u{20}\u{41}\u{63}\u{63}\u{6F}\u{75}\u{6E}\u{74}\u{73}")
        XCTAssertEqual(String.AUTH_ALERT_CANCEL｜Accounts, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}")
        XCTAssertEqual(String.AUTH_ALERT_MESSAGE_OSX｜Accounts, "\u{45}\u{6E}\u{74}\u{65}\u{72}\u{20}\u{74}\u{68}\u{65}\u{20}\u{70}\u{61}\u{73}\u{73}\u{77}\u{6F}\u{72}\u{64}\u{20}\u{66}\u{6F}\u{72}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{20}\u{69}\u{6E}\u{20}\u{53}\u{79}\u{73}\u{74}\u{65}\u{6D}\u{20}\u{50}\u{72}\u{65}\u{66}\u{65}\u{72}\u{65}\u{6E}\u{63}\u{65}\u{73}\u{2E}")
        XCTAssertEqual(String.AUTH_ALERT_PREFERENCES｜Accounts, "\u{50}\u{72}\u{65}\u{66}\u{65}\u{72}\u{65}\u{6E}\u{63}\u{65}\u{73}\u{2026}")
        XCTAssertEqual(String.AUTH_ALERT_SETTINGS｜Accounts, "\u{53}\u{65}\u{74}\u{74}\u{69}\u{6E}\u{67}\u{73}")
        XCTAssertEqual(String.AUTH_ALERT_TITLE｜Accounts, "\u{45}\u{6E}\u{74}\u{65}\u{72}\u{20}\u{74}\u{68}\u{65}\u{20}\u{25}\u{40}\u{20}\u{70}\u{61}\u{73}\u{73}\u{77}\u{6F}\u{72}\u{64}\u{20}\u{66}\u{6F}\u{72}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{20}\u{69}\u{6E}\u{20}\u{53}\u{65}\u{74}\u{74}\u{69}\u{6E}\u{67}\u{73}\u{2E}")
        XCTAssertEqual(String.AUTH_ALERT_TITLE_OSX｜Accounts, "\u{25}\u{40}\u{20}\u{50}\u{61}\u{73}\u{73}\u{77}\u{6F}\u{72}\u{64}")
        XCTAssertEqual(String.CANCEL｜Accounts, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}")
        XCTAssertEqual(String.CONTINUE｜Accounts, "\u{43}\u{6F}\u{6E}\u{74}\u{69}\u{6E}\u{75}\u{65}")
        XCTAssertEqual(String.DONT_ALLOW｜Accounts, "\u{44}\u{6F}\u{6E}\u{2019}\u{74}\u{20}\u{41}\u{6C}\u{6C}\u{6F}\u{77}")
        XCTAssertEqual(String.ICLOUD_STORAGE｜Accounts, "\u{69}\u{43}\u{6C}\u{6F}\u{75}\u{64}\u{20}\u{53}\u{74}\u{6F}\u{72}\u{61}\u{67}\u{65}")
        XCTAssertEqual(String.NEW_ACCOUNT_MESSAGE｜Accounts, "\u{25}\u{40}\u{20}\u{68}\u{61}\u{73}\u{20}\u{62}\u{65}\u{65}\u{6E}\u{20}\u{61}\u{64}\u{64}\u{65}\u{64}\u{2E}")
        XCTAssertEqual(String.NEW_ACCOUNT_MULTIPLE_MESSAGE｜Accounts, "\u{53}\u{65}\u{76}\u{65}\u{72}\u{61}\u{6C}\u{20}\u{6E}\u{65}\u{77}\u{20}\u{61}\u{63}\u{63}\u{6F}\u{75}\u{6E}\u{74}\u{73}\u{20}\u{68}\u{61}\u{76}\u{65}\u{20}\u{62}\u{65}\u{65}\u{6E}\u{20}\u{61}\u{64}\u{64}\u{65}\u{64}\u{2E}")
        XCTAssertEqual(String.NEW_ACCOUNT_MULTIPLE_TITLE｜Accounts, "\u{4E}\u{65}\u{77}\u{20}\u{41}\u{63}\u{63}\u{6F}\u{75}\u{6E}\u{74}\u{73}\u{20}\u{41}\u{64}\u{64}\u{65}\u{64}")
        XCTAssertEqual(String.NEW_ACCOUNT_MUTLIPLE_BUTTON_TITLE｜Accounts, "\u{53}\u{65}\u{74}\u{74}\u{69}\u{6E}\u{67}\u{73}")
        XCTAssertEqual(String.NEW_ACCOUNT_TITLE｜Accounts, "\u{25}\u{40}\u{20}\u{41}\u{63}\u{63}\u{6F}\u{75}\u{6E}\u{74}\u{20}\u{41}\u{64}\u{64}\u{65}\u{64}")
        XCTAssertEqual(String.OK｜Accounts, "\u{4F}\u{4B}")
        XCTAssertEqual(String.TURN_ON｜Accounts, "\u{54}\u{75}\u{72}\u{6E}\u{20}\u{4F}\u{6E}")
        XCTAssertEqual(String.VERIFICATION_REQUIRED_MESSAGE_FORMAT｜Accounts, "\u{4C}\u{6F}\u{67}\u{20}\u{69}\u{6E}\u{20}\u{74}\u{6F}\u{20}\u{79}\u{6F}\u{75}\u{72}\u{20}\u{25}\u{40}\u{20}\u{61}\u{63}\u{63}\u{6F}\u{75}\u{6E}\u{74}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{2E}")
        XCTAssertEqual(String.VERIFICATION_REQUIRED_TITLE｜Accounts, "\u{56}\u{65}\u{72}\u{69}\u{66}\u{69}\u{63}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{20}\u{52}\u{65}\u{71}\u{75}\u{69}\u{72}\u{65}\u{64}")
    }

    func test_ar() {
        Util｜Accounts.preferredLocalization = "\u{61}\u{72}"
        XCTAssertEqual(String.ACCOUNT_ACCESS_MESSAGE｜Accounts, "\u{64A}\u{631}\u{63A}\u{628}\u{20}\u{22}\u{25}\u{31}\u{24}\u{40}\u{22}\u{20}\u{628}\u{627}\u{644}\u{648}\u{635}\u{648}\u{644}\u{20}\u{625}\u{644}\u{649}\u{20}\u{62D}\u{633}\u{627}\u{628}\u{627}\u{62A}\u{20}\u{25}\u{32}\u{24}\u{40}")
        XCTAssertEqual(String.AUTH_ALERT_CANCEL｜Accounts, "\u{625}\u{644}\u{63A}\u{627}\u{621}")
        XCTAssertEqual(String.AUTH_ALERT_MESSAGE_OSX｜Accounts, "\u{623}\u{62F}\u{62E}\u{644}\u{20}\u{643}\u{644}\u{645}\u{629}\u{20}\u{633}\u{631}\u{20}\u{644}\u{640}\u{20}\u{22}\u{25}\u{40}\u{22}\u{20}\u{641}\u{64A}\u{20}\u{62A}\u{641}\u{636}\u{64A}\u{644}\u{627}\u{62A}\u{20}\u{627}\u{644}\u{646}\u{638}\u{627}\u{645}\u{2E}")
        XCTAssertEqual(String.AUTH_ALERT_PREFERENCES｜Accounts, "\u{627}\u{644}\u{62A}\u{641}\u{636}\u{64A}\u{644}\u{627}\u{62A}\u{2026}")
        XCTAssertEqual(String.AUTH_ALERT_SETTINGS｜Accounts, "\u{627}\u{644}\u{625}\u{639}\u{62F}\u{627}\u{62F}\u{627}\u{62A}")
        XCTAssertEqual(String.AUTH_ALERT_TITLE｜Accounts, "\u{623}\u{62F}\u{62E}\u{644}\u{20}\u{643}\u{644}\u{645}\u{629}\u{20}\u{633}\u{631}\u{20}\u{25}\u{40}\u{20}\u{644}\u{640}\u{20}\u{22}\u{25}\u{40}\u{22}\u{20}\u{641}\u{64A}\u{20}\u{627}\u{644}\u{625}\u{639}\u{62F}\u{627}\u{62F}\u{627}\u{62A}\u{2E}")
        XCTAssertEqual(String.AUTH_ALERT_TITLE_OSX｜Accounts, "\u{643}\u{644}\u{645}\u{629}\u{20}\u{633}\u{631}\u{20}\u{25}\u{40}\u{200E}")
        XCTAssertEqual(String.CANCEL｜Accounts, "\u{625}\u{644}\u{63A}\u{627}\u{621}")
        XCTAssertEqual(String.CONTINUE｜Accounts, "\u{645}\u{62A}\u{627}\u{628}\u{639}\u{629}")
        XCTAssertEqual(String.DONT_ALLOW｜Accounts, "\u{639}\u{62F}\u{645}\u{20}\u{627}\u{644}\u{633}\u{645}\u{627}\u{62D}")
        XCTAssertEqual(String.ICLOUD_STORAGE｜Accounts, "\u{62A}\u{62E}\u{632}\u{64A}\u{646}\u{20}\u{69}\u{43}\u{6C}\u{6F}\u{75}\u{64}")
        XCTAssertEqual(String.NEW_ACCOUNT_MESSAGE｜Accounts, "\u{62A}\u{645}\u{62A}\u{20}\u{625}\u{636}\u{627}\u{641}\u{629}\u{20}\u{25}\u{40}\u{2E}")
        XCTAssertEqual(String.NEW_ACCOUNT_MULTIPLE_MESSAGE｜Accounts, "\u{62A}\u{645}\u{62A}\u{20}\u{625}\u{636}\u{627}\u{641}\u{629}\u{20}\u{627}\u{644}\u{639}\u{62F}\u{64A}\u{62F}\u{20}\u{645}\u{646}\u{20}\u{627}\u{644}\u{62D}\u{633}\u{627}\u{628}\u{627}\u{62A}\u{20}\u{627}\u{644}\u{62C}\u{62F}\u{64A}\u{62F}\u{629}\u{2E}")
        XCTAssertEqual(String.NEW_ACCOUNT_MULTIPLE_TITLE｜Accounts, "\u{62A}\u{645}\u{62A}\u{20}\u{625}\u{636}\u{627}\u{641}\u{629}\u{20}\u{62D}\u{633}\u{627}\u{628}\u{627}\u{62A}\u{20}\u{62C}\u{62F}\u{64A}\u{62F}\u{629}")
        XCTAssertEqual(String.NEW_ACCOUNT_MUTLIPLE_BUTTON_TITLE｜Accounts, "\u{627}\u{644}\u{625}\u{639}\u{62F}\u{627}\u{62F}\u{627}\u{62A}")
        XCTAssertEqual(String.NEW_ACCOUNT_TITLE｜Accounts, "\u{62A}\u{645}\u{62A}\u{20}\u{625}\u{636}\u{627}\u{641}\u{629}\u{20}\u{627}\u{644}\u{62D}\u{633}\u{627}\u{628}\u{20}\u{25}\u{40}")
        XCTAssertEqual(String.OK｜Accounts, "\u{645}\u{648}\u{627}\u{641}\u{642}")
        XCTAssertEqual(String.TURN_ON｜Accounts, "\u{62A}\u{634}\u{63A}\u{64A}\u{644}")
        XCTAssertEqual(String.VERIFICATION_REQUIRED_MESSAGE_FORMAT｜Accounts, "\u{633}\u{62C}\u{651}\u{644}\u{20}\u{627}\u{644}\u{62F}\u{62E}\u{648}\u{644}\u{20}\u{625}\u{644}\u{649}\u{20}\u{62D}\u{633}\u{627}\u{628}\u{202A}\u{20}\u{25}\u{40}\u{202C}\u{20}\u{22}\u{25}\u{40}\u{22}\u{2E}")
        XCTAssertEqual(String.VERIFICATION_REQUIRED_TITLE｜Accounts, "\u{645}\u{637}\u{644}\u{648}\u{628}\u{20}\u{627}\u{644}\u{62A}\u{62D}\u{642}\u{642}")
    }

    func test_ca() {
        Util｜Accounts.preferredLocalization = "\u{63}\u{61}"
        XCTAssertEqual(String.ACCOUNT_ACCESS_MESSAGE｜Accounts, "\u{201C}\u{25}\u{31}\u{24}\u{40}\u{201D}\u{20}\u{76}\u{6F}\u{6C}\u{20}\u{61}\u{63}\u{63}\u{65}\u{64}\u{69}\u{72}\u{20}\u{61}\u{6C}\u{73}\u{20}\u{63}\u{6F}\u{6D}\u{70}\u{74}\u{65}\u{73}\u{20}\u{64}\u{65}\u{20}\u{25}\u{32}\u{24}\u{40}")
        XCTAssertEqual(String.AUTH_ALERT_CANCEL｜Accounts, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}\u{B7}\u{6C}\u{61}\u{72}")
        XCTAssertEqual(String.AUTH_ALERT_MESSAGE_OSX｜Accounts, "\u{45}\u{73}\u{63}\u{72}\u{69}\u{75}\u{20}\u{6C}\u{61}\u{20}\u{63}\u{6F}\u{6E}\u{74}\u{72}\u{61}\u{73}\u{65}\u{6E}\u{79}\u{61}\u{20}\u{64}\u{65}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{20}\u{61}\u{20}\u{50}\u{72}\u{65}\u{66}\u{65}\u{72}\u{E8}\u{6E}\u{63}\u{69}\u{65}\u{73}\u{20}\u{64}\u{65}\u{6C}\u{20}\u{53}\u{69}\u{73}\u{74}\u{65}\u{6D}\u{61}\u{2E}")
        XCTAssertEqual(String.AUTH_ALERT_PREFERENCES｜Accounts, "\u{50}\u{72}\u{65}\u{66}\u{65}\u{72}\u{E8}\u{6E}\u{63}\u{69}\u{65}\u{73}\u{2026}")
        XCTAssertEqual(String.AUTH_ALERT_SETTINGS｜Accounts, "\u{43}\u{6F}\u{6E}\u{66}\u{69}\u{67}\u{75}\u{72}\u{61}\u{63}\u{69}\u{F3}")
        XCTAssertEqual(String.AUTH_ALERT_TITLE｜Accounts, "\u{45}\u{73}\u{63}\u{72}\u{69}\u{75}\u{20}\u{6C}\u{61}\u{20}\u{63}\u{6F}\u{6E}\u{74}\u{72}\u{61}\u{73}\u{65}\u{6E}\u{79}\u{61}\u{20}\u{64}\u{65}\u{20}\u{25}\u{40}\u{20}\u{70}\u{65}\u{72}\u{20}\u{61}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{20}\u{61}\u{20}\u{43}\u{6F}\u{6E}\u{66}\u{69}\u{67}\u{75}\u{72}\u{61}\u{63}\u{69}\u{F3}\u{2E}")
        XCTAssertEqual(String.AUTH_ALERT_TITLE_OSX｜Accounts, "\u{43}\u{6F}\u{6E}\u{74}\u{72}\u{61}\u{73}\u{65}\u{6E}\u{79}\u{61}\u{20}\u{25}\u{40}")
        XCTAssertEqual(String.CANCEL｜Accounts, "\u{43}\u{61}\u{6E}\u{63}\u{65}\u{6C}\u{B7}\u{6C}\u{61}\u{72}")
        XCTAssertEqual(String.CONTINUE｜Accounts, "\u{43}\u{6F}\u{6E}\u{74}\u{69}\u{6E}\u{75}\u{61}\u{72}")
        XCTAssertEqual(String.DONT_ALLOW｜Accounts, "\u{4E}\u{6F}\u{20}\u{70}\u{65}\u{72}\u{6D}\u{65}\u{74}\u{72}\u{65}")
        XCTAssertEqual(String.ICLOUD_STORAGE｜Accounts, "\u{45}\u{6D}\u{6D}\u{61}\u{67}\u{61}\u{74}\u{7A}\u{65}\u{6D}\u{61}\u{74}\u{67}\u{65}\u{20}\u{61}\u{20}\u{6C}\u{2019}\u{69}\u{43}\u{6C}\u{6F}\u{75}\u{64}")
        XCTAssertEqual(String.NEW_ACCOUNT_MESSAGE｜Accounts, "\u{25}\u{40}\u{20}\u{73}\u{2019}\u{68}\u{61}\u{20}\u{61}\u{66}\u{65}\u{67}\u{69}\u{74}\u{2E}")
        XCTAssertEqual(String.NEW_ACCOUNT_MULTIPLE_MESSAGE｜Accounts, "\u{53}\u{2019}\u{68}\u{61}\u{6E}\u{20}\u{61}\u{66}\u{65}\u{67}\u{69}\u{74}\u{20}\u{64}\u{69}\u{76}\u{65}\u{72}\u{73}\u{6F}\u{73}\u{20}\u{63}\u{6F}\u{6D}\u{70}\u{74}\u{65}\u{73}\u{20}\u{6E}\u{6F}\u{75}\u{73}\u{2E}")
        XCTAssertEqual(String.NEW_ACCOUNT_MULTIPLE_TITLE｜Accounts, "\u{43}\u{6F}\u{6D}\u{70}\u{74}\u{65}\u{73}\u{20}\u{6E}\u{6F}\u{75}\u{73}\u{20}\u{61}\u{66}\u{65}\u{67}\u{69}\u{74}\u{73}")
        XCTAssertEqual(String.NEW_ACCOUNT_MUTLIPLE_BUTTON_TITLE｜Accounts, "\u{43}\u{6F}\u{6E}\u{66}\u{69}\u{67}\u{75}\u{72}\u{61}\u{63}\u{69}\u{F3}")
        XCTAssertEqual(String.NEW_ACCOUNT_TITLE｜Accounts, "\u{43}\u{6F}\u{6D}\u{70}\u{74}\u{65}\u{20}\u{25}\u{40}\u{20}\u{61}\u{66}\u{65}\u{67}\u{69}\u{74}")
        XCTAssertEqual(String.OK｜Accounts, "\u{4F}\u{4B}")
        XCTAssertEqual(String.TURN_ON｜Accounts, "\u{41}\u{63}\u{74}\u{69}\u{76}\u{61}\u{72}")
        XCTAssertEqual(String.VERIFICATION_REQUIRED_MESSAGE_FORMAT｜Accounts, "\u{49}\u{6E}\u{69}\u{63}\u{69}\u{61}\u{20}\u{73}\u{65}\u{73}\u{73}\u{69}\u{F3}\u{20}\u{61}\u{6C}\u{20}\u{63}\u{6F}\u{6D}\u{70}\u{74}\u{65}\u{20}\u{25}\u{40}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{2E}")
        XCTAssertEqual(String.VERIFICATION_REQUIRED_TITLE｜Accounts, "\u{56}\u{65}\u{72}\u{69}\u{66}\u{69}\u{63}\u{61}\u{63}\u{69}\u{F3}\u{20}\u{6F}\u{62}\u{6C}\u{69}\u{67}\u{61}\u{74}\u{F2}\u{72}\u{69}\u{61}")
    }

    func test_cs() {
        Util｜Accounts.preferredLocalization = "\u{63}\u{73}"
        XCTAssertEqual(String.ACCOUNT_ACCESS_MESSAGE｜Accounts, "\u{201E}\u{25}\u{31}\u{24}\u{40}\u{201C}\u{20}\u{17E}\u{E1}\u{64}\u{E1}\u{20}\u{6F}\u{A0}\u{70}\u{159}\u{ED}\u{73}\u{74}\u{75}\u{70}\u{20}\u{6B}\u{A0}\u{FA}\u{10D}\u{74}\u{16F}\u{6D}\u{20}\u{25}\u{32}\u{24}\u{40}")
