        XCTAssertEqual(String.AUTH_ALERT_SETTINGS｜Accounts, "\u{4E}\u{61}\u{73}\u{74}\u{61}\u{76}\u{65}\u{6E}\u{ED}")
        XCTAssertEqual(String.AUTH_ALERT_TITLE｜Accounts, "\u{56}\u{A0}\u{4E}\u{61}\u{73}\u{74}\u{61}\u{76}\u{65}\u{6E}\u{ED}\u{20}\u{7A}\u{61}\u{64}\u{65}\u{6A}\u{74}\u{65}\u{20}\u{68}\u{65}\u{73}\u{6C}\u{6F}\u{20}\u{75}\u{17E}\u{69}\u{76}\u{61}\u{74}\u{65}\u{6C}\u{65}\u{20}\u{25}\u{32}\u{24}\u{40}\u{20}\u{73}\u{6C}\u{75}\u{17E}\u{62}\u{79}\u{20}\u{25}\u{31}\u{24}\u{40}\u{2E}")
        XCTAssertEqual(String.AUTH_ALERT_TITLE_OSX｜Accounts, "\u{48}\u{65}\u{73}\u{6C}\u{6F}\u{20}\u{70}\u{72}\u{6F}\u{20}\u{25}\u{40}")
        XCTAssertEqual(String.CANCEL｜Accounts, "\u{5A}\u{72}\u{75}\u{161}\u{69}\u{74}")
        XCTAssertEqual(String.CONTINUE｜Accounts, "\u{50}\u{6F}\u{6B}\u{72}\u{61}\u{10D}\u{6F}\u{76}\u{61}\u{74}")
