        XCTAssertEqual(String.NEW_ACCOUNT_MESSAGE｜Accounts, "\u{DA}\u{10D}\u{65}\u{74}\u{20}\u{25}\u{40}\u{20}\u{62}\u{79}\u{6C}\u{20}\u{70}\u{159}\u{69}\u{64}\u{E1}\u{6E}\u{2E}")
